import { useForm } from "react-hook-form";
import { useAuth } from "../commons/auth/auth-context";
import {getService} from "../axios/adminServices"
function Admin() {

  const {token} = useAuth();
  const { register, errors, formState, handleSubmit, setError } = useForm({
    mode: "onBlur" // Lanza validaciones cada vez que hago blur
  });



  
  let login = document.getElementById('login');
 if(login!=null){
  login.innerHTML=""  
  login.parentNode.removeChild(login);

 const handleSignUp = formData => {
    return signUp(formData).catch(error => {
         let status=document.getElementById('status');
      if (error.response.status === 409) {
        status.innerHTML="The email already exists. Please try again";
           setError(
          "email",
          "conflict",
          "The email already exists. Please try again"
        );
      }else{
           status.innerHTML=`Algo a ido mal intentelo de nuevo Error:${error.response.status}`;

      }
    });
  };

  solicitudes(token)
}
 return(
 <React.Fragment>
 <h1>Admin Page</h1>
 <fieldset id="solicitudes">
     
 </fieldset>
 </React.Fragment>)
}
export {Admin};

async function solicitudes(token){
    let response = await getService(token)
   let services = response.data;
   document.getElementById("solicitudes").innerHTML= "";

   for (const service of services) {
     let output = `<fieldset>
     <label>Solicitud:</label>
     <p>${service.content}</p>
     </fieldset>`
     console.log(service)
   document.getElementById("solicitudes").innerHTML= output + document.getElementById("solicitudes").innerHTML;
   }
   }
